import React, { Component } from 'react';

class LoginComponent extends Component {
    constructor(props){
        super(props)
        this.state={
            open:false,
        }
    }
    openClose=()=>{
        this.setState({
            open:!(this.state.open)
        })
    }
    render() {
        if(!this.state.open){

        return (
            <div>
               <button onClick={this.openClose}>Sign In</button> 
            </div>
        )} else if(this.state.open){         
        return (
            <div className='login'>

            </div>
        )
        }
    }
}

export default LoginComponent;
